import React from 'react';
import FormComponent from '../../components/form.component';

export default class CreateVisiteComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            visitesList: [{
                enterprise: "Carrefour",
                date: new Date(),
                id: "19920a3dd"
            },
            {
                enterprise: "Leclerc",
                date: new Date(),
                id: "127226rf3"
            },
            {
                enterprise: "Auchan",
                date: new Date(),
                id: "127236rdz2"
            }]
        }
    }
    render() {
        let forms = [
            [
                { type: 'input', label: 'Entreprise', placeholder: 'Entreprise' },
                { type: 'input', label: 'Siret', placeholder: 'Siret' }
            ],
            { type: 'input', label: 'Adresse', placeholder: 'Adresse' },
            { type: 'select', label: 'Action associées', placeholder: 'Action', options: ["1244", "EEEZ"] },

        ]
        return (
            <FormComponent onSubmit={(data) => console.log(data)} submitButtonText="Valider" forms={forms} />
        );
    }
}
